import React from 'react';

const Header = (): JSX.Element => (
    <header
        style={{
            background: `#red`,
            marginBottom: `1.45rem`,
        }}
    >
        <div
            style={{
                margin: `0 auto`,
                maxWidth: 960,
                padding: `1.45rem 1.0875rem`,
            }}
        >
            <h1 style={{ margin: 0 }}></h1>
        </div>
    </header>
);

export default Header;
